    "maryland-water-use-data-1998",nt"isopen": false,nt"url": null,nt"notes":
    "MDWU98 is a point coverage that represents the locations of wells for the State
    of Maryland that are permitted to withdraw 10,000 gallons or more per day by the
    Maryland Department of the Environment (MDE). Each site has the permit number, permit
    amount, reported withdrawal, aquifer code, and type of use. Information contained
    in the dataset comes from the U.S.Geological Survey site-specific water-use database
